import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="w-64 bg-white h-full shadow-md p-5">
      <h2 className="text-2xl font-bold text-blue-600 mb-8">ARMS-PORTAL</h2>
      <nav className="flex flex-col space-y-4">
        <Link to="/" className="hover:text-blue-600">Dashboard</Link>
        <Link to="/notes" className="hover:text-blue-600">Manage Notes</Link>
        <Link to="/syllabus" className="hover:text-blue-600">Manage Syllabus</Link>
        <Link to="/papers" className="hover:text-blue-600">Manage Question Papers</Link>
        <Link to="/universities" className="hover:text-blue-600">University Settings</Link>
      </nav>
    </div>
  );
};

export default Sidebar;
